import Slider from "../../components/Carousel/carousel";
import Presta from "../Presta/presta.tsx";
import Aboutme from "../Aboutme/aboutme.tsx";
import Instacontact from "../Instacontact/instacontact.tsx";
import Footer from "../../components/Footer/footer.tsx";
import { ConsentBanner, ConsentProvider } from "react-hook-consent";

const Home = () => {
  return (
    <div>
      <ConsentProvider
        options={{
          services: [
            {
              id: "myid",
              name: "MyName",
              scripts: [
                {
                  id: "external-script",
                  src: "https://myscript.com/script.js",
                },
                { id: "inline-code", code: `alert("I am a JavaScript code");` },
              ],
              cookies: [{ pattern: "cookie-name" }],
              localStorage: ["local-storage-key"],
              sessionStorage: ["session-storage-key"],
              mandatory: true,
            },
          ],
          // customHash: 'my-custom-hash', // optional, e.g. when changing the options based on language
          theme: "light",
        }}
      >
        <App />
        <ConsentBanner
          settings={{
            hidden: false,
            label: "More",
            modal: { title: "Modal title" },
          }}
          decline={{ hidden: false, label: "No" }}
          approve={{ label: "Yes" }}
        >
          <>
            Can we use cookies and external services according to our{" "}
            <a href="test">privacy policy</a> to improve the browsing
            experience?
          </>
        </ConsentBanner>
      </ConsentProvider>
      ;
      <Slider />
      <Presta />
      <Aboutme />
      <Instacontact />
      <Footer />
    </div>
  );
};

export default Home;
